import com.eviware.soapui.support.GroovyUtils

def groovyUtils = new GroovyUtils(context)
def requestXmlHolder = groovyUtils.getXmlHolder(mockRequest.getRequestContent())
def startIndex = Integer.parseInt(requestXmlHolder["//StartIndex"])
def endIndex = Integer.parseInt(requestXmlHolder["//EndIndex"])

log.info startIndex
log.info endIndex

if (endIndex < startIndex) {
	return 'Response error1'
}

else if (endIndex - startIndex + 1 > 100) {
	return 'Response error2'
}
else {
	return 'Response OK'
}

import com.eviware.soapui.support.GroovyUtils

def groovyUtils = new GroovyUtils(context)
def requestXmlHolder = groovyUtils.getXmlHolder(mockRequest.getRequestContent())
def source = requestXmlHolder["//Source"]
def destination = requestXmlHolder["//Destination"]

